import React, { useState } from 'react';

export function Button({event,handler}){
    return <button onClick={handler}>{event}</button>
}


export function DoubleButton({event0,event1,handler}){
    const [clicked,setClicked] = useState(false)

    function handleClick(){
        console.log(handler)
        setClicked(!clicked)
        handler();
    }

    return(
    <div>
        <button onClick={handleClick} disabled={clicked}>{event0}</button>
        <button onClick={handleClick} disabled={!clicked}>{event1}</button>
    </div> );


}
